import React, { Component } from 'react';
import { Link } from 'react-router-dom';

import './styles.scss';

export default class SobreDescricao extends Component {


    render() {
        return (
            <React.Fragment>
                {this.renderRedirect()}
                <section className="sobre">
                    <div className="container-sobre">
                        <h1 className="sobre-titulo">PlayerStars et dapibus tortor mollis justo accumsan, ac varius ante luctus. Quisque blandit ipsum sit amet urna.</h1>
                        <div className="div-descricao">
                            <p className="descricao-sobre">Donec vel sagittis odio. Pellentesque libero arcu, pharetra</p>
                            <p className="descricao-sobre">Cras condimentum venenatis facilisis. Curabitur mattis quam quis mi feugiat, ut blandit magna pharetra. Nunc</p>
                            <p className="descricao-sobre">Pellentesque at vestibulum tellus, vitae hendrerit felis.</p>
                            <p className="descricao-sobre">Quisque blandit ipsum sit amet urna viverra convallis. Classiti sociosqu ad litora torquent per conubia nostra, inceptos himenaeos. Sed sit amet posuere justo.</p>
                            <p className="descricao-sobre">Quisque blandit ipsum sit amet urna viverra convallis. Classiti sociosqu ad litora torquent per conubia nostra, inceptos himenaeos. Sed sit amet posuere justo.</p>
                            <button className="btn-participe" onClick={() => this.setState({redirect: true})}>Participe</button>
                        </div>
                    </div>
                </section>
            </React.Fragment>
        )
    }
}
